syntax = "proto3";
option java_package = "com.suremoon.hacknet.pb";
option java_outer_classname="hmsg";
option go_package = "github.com/ProtossGenius/hacknet/pb/hmsg;hmsg";
package hmsg;
import "google/protobuf/any.proto";
// Message BaseMessage.
message Message {
	int32 Enum = 1;
	string email = 2;
	google.protobuf.Any msg = 3;

	// Next available id: 1
}
